package Pattern;

public class Pattern_9026 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		char ch = 'A';
		
		for(int i=0;i<5;i++)
		{
			for(int j=0;j<5;j++)
			{
				System.out.print(ch+" ");
			}
			ch++;
			System.out.println();
		}
	
	}

}
/*
 * 	A A A A A
 *  B B B B B
 *  C C C C C
 *  D D D D D 
 *  E E E E E
 */


